    INNER JOIN users u on u.id = p.user_id
     
	
where
    p.user_id = u.id
	
    AND p.del_status = 1
    
    
	
	
    AND NOT FIND_IN_SET(\'\',p.hide) <> 0
    ORDER BY p.id DESC LIMIT 0, 9'
